 To implement a queue using two stacks in Python, we can use the following approach:

1. Push all elements into Stack 1 (initially, the queue).
2. When dequeuing an element, move all elements from Stack 1 to Stack 2. The first element in Stack 1 is the one to be dequeued.
3. After dequeuing an element, push it back into Stack 1 so that it's ready for enqueuing again.

Here's the code for this implementation:

```python
class Queue:
    def __init__(self):
        self.stack1 = []
        self.stack2 = []

    def enqueue(self, item):
        self.stack1.append(item)

    def dequeue(self):
        if not self.stack1:
            raise Exception("Queue is empty")

        if not self.stack2:
            while self.stack1:
                self.stack2.append(self.stack1.pop())

        return self.stack2.pop()

    def peek(self):
        if not self.stack1:
            raise Exception("Queue is empty")

        if not self.stack2:
            while self.stack1:
                self.stack2.append(self.stack1.pop())

        return self.stack2[-1]

    def is_empty(self):
        return not bool(self.stack1) and not bool(self.stack2)

# Usage
queue = Queue()
queue.enqueue(1)
queue.enqueue(2)
queue.enqueue(3)
print(queue.peek())  # Output: 1
print(queue.dequeue())  # Output: 1
print(queue.peek())  # Output: 2
```

In this implementation, we have a `Queue` class with methods for enqueuing, dequeuing, peeking, checking if the queue is empty, and getting the length of the queue. The `enqueue` method simply appends the item to Stack 1, while the `dequeue` method moves all elements from Stack 1 to Stack 2 and returns the first element in Stack 1. The `peek` method also moves all elements from Stack 1 to Stack 2 but does not remove the first element. The `is_empty` method checks if both stacks are empty.

This implementation ensures that the queue follows the First-In-First-Out (FIFO) principle.
